(() => {
const fiActiveStorageKey = '_fi_is_account_active'; const authSourceStorageKey = '_auth_sources'; const isInSatelliteMode =  false ;
  let loader = document.getElementById('loader');
  const loaderTimeout = 30000;
  const path = window.location.pathname;
  const showForPath = path.includes('/calls') ||
    path.includes('/conversations') ||
    path.includes('/intro') ||
    path.includes('/messagesSetup') ||
    path.includes('/settings') ||
    path.includes('/unableToConnect') ||
    path.includes('/updatePhone') ||
    path.includes('/voicemail') ||
    /\/web\/?([\?#]|$)/.test(path);

  window.mwFinishLoad = () => {
    if (isInSatelliteMode) {
      loader.style.display = 'none';
    } else {
      if (!loader) return;
      loader.parentElement.removeChild(loader);
      loader = undefined;
    }
  };

  let setLoaderFinishTimeout = true;
  if (isInSatelliteMode) {
    window.mwStartLoad = () => {
      // If the page explicitly triggers/starts the loader, then disable the loader timeout
      // that hides it. Avoids the scenario where the loader is explicitly triggered, but then
      // implicitly disabled by timeout.
      setLoaderFinishTimeout = false;
      let logo;
      if (useFi) {
        logo = loader.querySelector('.fl');
      } else {
        logo = loader.querySelector('.ld-logo');
      }

      if (logo) {
        logo.style.display = 'flex';
      }
      loader.style.display = 'flex';
    }

    setTimeout(() => {
      if (setLoaderFinishTimeout) {
        window.mwFinishLoad();
      }
    }, loaderTimeout);
  } else {
    setTimeout(window.mwFinishLoad, loaderTimeout);
  }

  function enableDarkMode() {
    loader.classList.add('dark');
    const metaThemeColorEl = document.querySelector('meta[name=theme-color]');
    metaThemeColorEl.setAttribute('content', '#3C4043');
  }

  // Use the Fi loader if the Fi account appears to still be active and previously
  // authenticated, and either the site was loaded with an account specific context or
  // there is no phone relay pairing.
  const useFi = localStorage.getItem(authSourceStorageKey) === 'F'
    && localStorage.getItem(fiActiveStorageKey) === 'true'
    && (path.includes('/u/') || !localStorage.getItem('pr_backend_type'));

  if (useFi) {
    document.title = 'Google Fi Wireless';

    for (const element1x of document.getElementsByClassName('favicon1x')) {
      element1x.setAttribute(
        'href',
        'https://ssl.gstatic.com/android-messages-web/images/fi/branding_v2/fi-favicon-default.png');
    }
    for (const element2x of document.getElementsByClassName('favicon2x')) {
      element2x.setAttribute(
        'href',
        'https://ssl.gstatic.com/android-messages-web/images/fi/branding_v2/fi-favicon-default-2x.png');
    }
  }

  if (showForPath && document.cookie.includes('pair_state_cookie=true')) {
    loader.style.display = 'flex';

    if (localStorage.getItem('dark_mode_enabled') === 'true') {
      enableDarkMode();
    } else if (localStorage.getItem('system_default_theme_enabled') === 'true' &&
               matchMedia('(prefers-color-scheme: dark)').matches) {
      enableDarkMode();
    }

    if (useFi) {
      document.querySelector('.fl').style.display = 'flex';
    } else {
      const logo = document.querySelector('.ld-logo');
      if (logo) {
        logo.style.display = 'flex';
      }
    }
  } else {
    window.mwFinishLoad();
